import React from 'react';
import { Form } from '../@commons/Form/Form';
import { Button } from '../@commons/Button/Button';

const RcpDisplayContainer = () => {
  return (
    <Form onSubmit={(e) => e.preventDefault()}>
      <p>가위바위보 그림</p>
      <Button title={'가위'} />
      <button>가위</button>
      <button>바위</button>
      <button>보</button>
      <p>나의 선택</p>
    </Form>
  );
};

export default RcpDisplayContainer;
